        <section class="course-overview" id="description-text-overview">
            <div class="container">
                <div class="row">
                    <div class="col-md-9 col-md-offset-3">
                        <h2 class="section-heading">Description</h2> <span class="reg-provider"> <i class="fa fa-check-square"></i> <span>Regd. Education Provider</span> <i class="accrediation-icons acdtn-page acdtn-page-27 nitro-lazy" style="background-image: url(&quot;https://d2o2utebsixu4k.cloudfront.net/assets/icons/acd-sprite.png&quot;);"></i> </span>
                        <div class="editor-content">
                            <p>For service managers and other professionals who are responsible for maintaining and managing service operations,day-to-day tasks would include service desk and service request management, incident and problem management and the interpretation and management of other service operation activities. The <strong>ITIL<sup>®</sup> intermediate SO or Service Operation Qualification</strong>, as the name suggests, is an intermediate certificate that focuses on these activities by giving you an introduction to the principles, processes, activities and functions of service operations, and the challenges, critical success factors and risks associated with it. Besides being a free standing qualification, it is also one of the modules that leads to the ITIL<strong><sup>®</sup></strong> Expert Certificate in IT Service Management.</p>
                            <p>This intensive examination is a reflection of your knowledge of industry best practices in service management as documented in the <em>ITIL Service Operation</em> publication. KnowledgeHut’s workshop is aimed at preparing you for this exam with in-depth courseware and coaching by industry experts who will familiarize you with the tips and tricks to clear the exam at the first go. Enrol today and start the process of becoming an ITIL<sup>®</sup> expert.</p>
                            <p>The ITIL<strong><sup>®</sup></strong> credit system maps out the route to achieving the ITIL<strong><sup>®</sup></strong> Expert certification. To learn more, visit <a href="https://www.axelos.com/certifications/itil-certifications/itil-credit-system" target="_blank" rel="nofollow">this link.</a></p>
                            <p>ITIL<sup>®</sup>, ITIL<sup>®</sup> Intermediate Service Operation, and AXELOS are registered trademarks of <a href="https://www.axelos.com/policies/legal/copyright-and-trade-marks" target="_blank" rel="nofollow">AXELOS Limited</a>, used under the permission of AXELOS Limited. The Swirl logo<sup>™</sup> is a trademark of AXELOS Limited, used under the permission of AXELOS Limited. PeopleCert<sup>®</sup> is the registered trademark of <a href="https://www.peoplecert.org/" target="_blank" rel="nofollow">PeopleCert International Ltd</a>., the sole Examination Institute (EI) for the delivery of AXELOS Accreditation and Examination services worldwide. KnowledgeHut is a Certified Partner of AXELOS and an Accredited Training Organization (ATO) with PeopleCert<sup>®</sup>.&nbsp;</p>
                            <p><img style="width:816px;" src="data:image/png;base64," data-filename="clipboard.png"><br></p>
                            <h6><b>What you will learn:</b></h6>
                            <p>On completion of this workshop and successful attempt of the examination, candidates will become proficient in:</p>
                            <ul>
                                <li>Service operation</li>
                                <li>Service operation principles</li>
                                <li>Service operation processes</li>
                                <li>Common service operation activities</li>
                                <li>Organizing for service operation: functions</li>
                                <li>Technology considerations</li>
                                <li>Implementation of service operation</li>
                                <li>Challenges, critical success factors and risks</li>
                            </ul>
                            <h6><b>You will also get:</b></h6>
