        <section class="faq" id="faq">
            <div class="container">
                <div class="row">
                    <div class="col-md-9 col-md-offset-3">
                        <h2 class="section-heading">Frequently Asked Questions</h2>
                        <div class="panel-group" id="faq-accordion" role="tablist" aria-multiselectable="true">
                            <div class="panel panel-default">
                                <div class="panel-heading active" role="tab" id="heading-faq-1">
                                    <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent="#faq-accordion" href="#faq-1" aria-expanded="true" aria-controls="faq-1"> Why should I go for this workshop? </a> </h4>
                                </div>
                                <div id="faq-1" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="heading-faq-1">
                                    <div class="panel-body editor-content">
                                        <p>ITIL<sup>®</sup> has been recognized as a quality benchmark in service management and is used by organizations to improve their ITSM practices. As an ITIL<sup>®</sup>Service Operation Expert your expertise would be in much demand, to improvise the IT operations of organizations. The ITIL<sup>®</sup> Intermediate Service Operation is not only an independent qualification but also one of the modules one has to achieve in order to become an ITIL<sup>®</sup> Expert. KnowledgeHut is an ATO of PEOPLECERT and a Certified Partner of Axelos to conduct ITIL<sup>®</sup> trainings and hence you will receive the best resources and coaching from experts certified in ITIL<sup>®</sup>. You will be thoroughly prepared to appear for the examination and gain the practical experience needed to shine at the workplace.<br></p>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="heading-faq-2">
                                    <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent="#faq-accordion" href="#faq-2" aria-expanded="true" aria-controls="faq-2"> How does one become an ITIL<sup>®</sup> Expert? </a> </h4>
                                </div>
                                <div id="faq-2" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-faq-2">
                                    <div class="panel-body editor-content">
                                        <p>There are two channels for becoming an ITIL<sup>®</sup> Expert. The Life Cycle modules route covers the following certifications:</p>
                                        <ol>
                                            <li>ITIL<strong><sup>®</sup></strong> Foundation</li>
                                            <li>ITIL<strong><sup>®</sup></strong> Service Operation (SO)</li>
                                            <li>ITIL<strong><sup>®</sup></strong> Service Strategy (SS)</li>
                                            <li>ITIL<strong><sup>®</sup></strong>Intermediate Service Design (SD)</li>
                                            <li>ITIL<strong><sup>®</sup></strong> Service Transition (ST)</li>
                                            <li>ITIL<strong><sup>®</sup></strong> Continual Service Improvement (CSI)</li>
                                        </ol>
                                        <p>The Capability modules route covers the following certifications:</p>
                                        <ol>
                                            <li>ITIL<strong><sup>®</sup></strong> Release Control &amp; Validation(RCV)</li>
                                            <li>ITIL<strong><sup>®</sup></strong> Planning Protection and Optimization (PPO)</li>
                                            <li>ITIL<strong><sup>®</sup></strong> Practitioner</li>
                                            <li>ITIL<strong><sup>®</sup></strong> Intermediate MALC Manage Across Lifecycle</li>
                                            <li>ITIL<strong><sup>®</sup></strong> Capability Expert</li>
                                        </ol>
                                        <p>A total of 22 credits are required to be eligible for ITIL<strong><sup>®</sup></strong> Expert level.A mix of modules from Life Cycle and Capability channels is allowed provided there is no overlap of syllabus units.</p>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="heading-faq-3">
                                    <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent="#faq-accordion" href="#faq-3" aria-expanded="true" aria-controls="faq-3"> Who is the target audience for this course? </a> </h4>
                                </div>
                                <div id="faq-3" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-faq-3">
                                    <div class="panel-body editor-content">
                                        <p>This workshop and the subsequent certification will benefit:</p>
                                        <ul>
                                            <li>Service managers, operations managers and help desk managers responsible for implementing and improving service operation.</li>
                                            <li>IT professionals who are working within or about to work in Service Operations environment such as IT architects, IT planners, IT consultants, IT audit managers, IT security managers.</li>
                                            <li>Those seeking to gain the ITIL Expert Certification or higher ITIL<sup>®</sup>certifications for which this is a prerequisite.</li>
                                        </ul>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="heading-faq-4">
                                    <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent="#faq-accordion" href="#faq-4" aria-expanded="true" aria-controls="faq-4"> Where can I find more information regarding the syllabus? </a> </h4>
                                </div>
                                <div id="faq-4" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-faq-4">
                                    <div class="panel-body editor-content">
                                        <p>You can read more in the <a rel="nofollow" href="https://www.axelos.com/Corporate/media/Files/Syllabi/The_ITIL_Intermediate_Qualification_Service_Operation_Certificate_Syllabus_v5-4.pdf" target="_blank">syllabus.</a></p>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="heading-faq-5">
                                    <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent="#faq-accordion" href="#faq-5" aria-expanded="true" aria-controls="faq-5"> Where can I find sample papers? </a> </h4>
                                </div>
                                <div id="faq-5" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-faq-5">
                                    <div class="panel-body editor-content">
                                        <p>Sample papers shall be shared during the training along with the student manual.<br></p>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="heading-faq-6">
                                    <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent="#faq-accordion" href="#faq-6" aria-expanded="true" aria-controls="faq-6"> Is the ITIL<sup>®</sup> Intermediate SO or Service Operation Qualification conducted as an online/ virtual course? </a> </h4>
                                </div>
                                <div id="faq-6" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-faq-6">
                                    <div class="panel-body editor-content">
                                        <p>No, there is no online/virtual course for this. The ITIL<sup>®</sup> Intermediate SO or Service Operation Qualification requires in-depth knowledge of the ITIL<sup>®</sup> framework which you get from our certified experts who lead the workshop.</p>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="heading-faq-7">
                                    <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent="#faq-accordion" href="#faq-7" aria-expanded="true" aria-controls="faq-7"> How many credits will I be eligible for? </a> </h4>
                                </div>
                                <div id="faq-7" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-faq-7">
                                    <div class="panel-body editor-content">
                                        <p>You will get 3 credits toward ITIL<sup>®</sup> Expert certification and 21 PDUs for PMI<sup>®</sup> recertification.<br></p>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="heading-faq-8">
                                    <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent="#faq-accordion" href="#faq-8" aria-expanded="true" aria-controls="faq-8"> Where are PDUs applicable? </a> </h4>
                                </div>
                                <div id="faq-8" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-faq-8">
                                    <div class="panel-body editor-content">
                                        <p>PDUs are credits awarded by the Project Management Institute. They recognize your dedication to the Agile world through the award of credits for every educational effort you make throughout your career. PDUs are offered by the PMI<sup>®</sup>, and every PMI<sup>®</sup> certification, except the CAPM<sup>®</sup>, requires you to earn a specific number of PDUs per three-year certification cycle.<br></p>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="heading-faq-9">
                                    <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent="#faq-accordion" href="#faq-9" aria-expanded="true" aria-controls="faq-9"> Should I pay separately for the certification fee? </a> </h4>
                                </div>
                                <div id="faq-9" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-faq-9">
                                    <div class="panel-body editor-content">
                                        <p>No, your course fee includes the certification exam fee.</p>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="heading-faq-10">
                                    <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent="#faq-accordion" href="#faq-10" aria-expanded="true" aria-controls="faq-10"> After enrolment what if I have to change the city, place and date for any of the classroom training </a> </h4>
                                </div>
                                <div id="faq-10" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-faq-10">
                                    <div class="panel-body editor-content">
                                        <p>You are welcome to revise the choice of city, place and date for any classroom training, if required. However, if it is cross-country, then there will be a revision in the training fee.<br></p>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="heading-faq-11">
                                    <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent="#faq-accordion" href="#faq-11" aria-expanded="true" aria-controls="faq-11"> If I cancel the enrolment, will I get a refund? </a> </h4>
                                </div>
                                <div id="faq-11" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-faq-11">
                                    <div class="panel-body editor-content">
                                        <p>Any registration cancelled within 48 hours of the initial registration will be refunded in FULL (please note that all cancellations will incur a 5% deduction in the refunded amount due to transactional costs applicable while refunding) Refunds will be processed within 30 days of receipt of written request for refund. Kindly go through our Refund Policy for more details:&nbsp; <a href="#" target="_blank">#</a></p>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="heading-faq-12">
                                    <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent="#faq-accordion" href="#faq-12" aria-expanded="true" aria-controls="faq-12"> What is the payment process to enrol for the training? </a> </h4>
                                </div>
                                <div id="faq-12" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-faq-12">
                                    <div class="panel-body editor-content">
                                        <p>It is easy to enrol for the training online. There are several options to pay either through your debit/credit card that includes Visa Card, MasterCard; American Express or - via PayPal. Payment receipt will be issued to the candidate automatically by email.<br></p>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="heading-faq-13">
                                    <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent="#faq-accordion" href="#faq-13" aria-expanded="true" aria-controls="faq-13"> Have more doubts? </a> </h4>
                                </div>
                                <div id="faq-13" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-faq-13">
                                    <div class="panel-body editor-content">
                                        <p>Please send in an email to <a href="https://mailto:support@knowledgehut.com" target="_blank">support@knowledgehut.com</a>, and we will answer any queries you may have!</p>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </section>
    </div>
